ALTER TABLE public.ockovaci_misto ADD COLUMN nazev_odkaz character varying COLLATE pg_catalog."default";

CREATE TABLE public.ockovaci_misto_tmp (LIKE public.ockovaci_misto INCLUDING ALL);


UPDATE public.ockovaci_misto m SET covtest_id = t.covtest_id, nazev_odkaz = t.nazev_odkaz FROM public.ockovaci_misto_tmp t WHERE m.nazev = t.nazev;

DROP TABLE public.ockovaci_misto_tmp;

